import './App.css';
import {Router, Link} from 'react-router-dom';

function App() {
  return (

    <div>
      <nav className="navbar bg-dark navbar-light">
        <div class="navitem">Home</div>
      </nav>

      <Router>
        <Link exact to="/" content="<Home />"></Link>
        <Link exact to="/creteProp" content="<CreateProp />"></Link>
        <Link exact to="/editProp" content="<EditProp />"></Link>
      </Router>
    </div>
  );
}

export default App;
